import React from 'react'

function Home() {
  return (
    <div className='Home' id="home" className="flex j-center a-center full flex-column gap">
      <img src="images/depot-logo.png" alt="Depot Logo" className="absolute" />
      <h1 className="light">Welcome Admin</h1>
      <p className="text-clr text-center">
        Welcome to the administrative home page of our e-commerce platform, <br /> where you can efficiently manage products, orders, and customer interactions with ease.
      </p>
    </div>
  )
}

export default Home
